var chara=[];
window.onload=function() {
	window.setInterval(viwe,500);
};

document.onkeydown=function (e){
	input="";
	if(e.keyCode==37){
		input="左";
	}else if(e.keyCode==38){
		input="上";
	}else if(e.keyCode==39){
		input="右";
	}else if(e.keyCode==40){
		input="下";
	}else if(e.keyCode==90||e.keyCode==13){
		input="OK";
		cutted();
	}
	if(input!="")main(input);
};
document.onkeyup=function (e){
	main("STOP");
};
function main(i){
	if(i=="STOP"){

	}
	console.log(i);
}
function viwe(){
	
}
function cutted(){

	var img=new Image();
	//img.src="./img/school02.png";
	img.src="data:image/png;base64,";

	img.onload = function() {
		var canvas=document.createElement('canvas');
		var ctx=canvas.getContext('2d');
		canvas.width=img.width/3;
		canvas.height=img.height/4;
		for(i=0;i<4;i++){
			chara[i]=[];
			for(j=0;j<3;j++){
				ctx.drawImage(img,j*(img.width/3),i*(img.height/4),img.width/3,img.height/4,0,0,img.width/3,img.height/4);
				
				chara[i][j]=canvas.toDataURL();
				ctx.clearRect(0,0,canvas.width,canvas.height);
			}
		}
	};
}